import React, { Component } from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import Header from './Header'

const Home = () => {
	return(
		<h1 className="bg-primary text-white text-center">Home</h1>
	)
}
const Listmembre = () => {
	return(
		<h1 className="bg-primary text-white text-center">List of membre</h1>
	)
}
const Addmembre = () => {
	return(
		<h1 className="bg-primary text-white text-center">Add membre</h1>
	)
}

class App extends Component{
	render(){
		return(
			<section id="todo">
				<BrowserRouter>
					<Fragment>
						<Switch>
							<Route path="/" render={(props)=> <AddTask {...props} onAddTask={this.onAddTask} />} />
							<Route path="/:filter?" render={(props) => <ToDoList {...props} tasks={this.state.tasks} onToggleCompleted={this.onToggleCompleted} />} />
						</Switch>
						<NavBar onDeleteCompleted={this.onDeleteCompleted} />
					</Fragment>
				</BrowserRouter>
      </section>
	)}
}

export default App
